import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input and type a partial query
    const searchInput = page.locator('#searchInput');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.type('elec', { delay: 100 }); // Use type to simulate user input and trigger events

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_typed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_typed.png'));

    // 2. Wait for the autocomplete suggestions to appear
    // The JS creates a div with class 'search-suggestions'
    await page.waitForSelector('.search-suggestions', { state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestions_visible.png'));

    // 3. Extract suggestion text
    const suggestions = await page.locator('.suggestion-item').allTextContents();

    // 4. Click the first suggestion
    const firstSuggestion = page.locator('.suggestion-item').first();
    await firstSuggestion.click();

    // 5. Verify the search input value has been updated
    const finalInputValue = await searchInput.inputValue();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_suggestion_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_suggestion_selected.png'));

    return {
      success: true,
      action: "Tested search autocomplete by typing, verifying suggestions, and selecting one.",
      extractedData: {
        initialSearchQuery: "elec",
        autocompleteSuggestions: suggestions,
        selectedValue: finalInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
